  false,\n\t\"url\": null,\n\t\"notes\": \"The California Protected Areas Database
  (CPAD) contains data on lands owned in fee by governments, non-profits and some
  private entities that are protected for open space purposes. Data includes all such
  areas in California, from small urban parks to large national parks and forests,
  mostly aligned to assessor parcel boundaries. Data is collected by Holdings (usually
  parcels) which are aggregated to Units (commonly named areas within a county) and
  Super Units (commonly named areas across county boundaries) - separate shape files
  are provided for each of those data elements, along with a detailed CPAD Manual
  and a summary Release Notice. This CPAD data release is version 1.9, completed in
  March 2013 by Greeninfo Network and published in April 2013 on the California GIS
  Portal. Data on conservation easements is being developed in a separate database,
  the California Conservation Easement Database (CCED). Learn more about CPAD at www.CALands.org.
  Before using the data, users must review the Data Disclaimer in the CPAD Manual.\",\n\t\"owner_org\":
